import '../css/inicio-web.css';
import ThreeDots from '../components/three-dots';
import SocialMedia from '../components/social-media';


function InicioWeb() {
  return (
    <div className="InicioWeb">
      <div className='inicio-web-top'>
        
      </div>

      <div className='image-container'>
      <img
        className='aimas-big-logo-image'
        src={require(`../images/aimas-logo-big.png`)}
        alt='Aimas Big Logo Image'
        />
      </div>

      <div class="row">
        <div class="col-md-3">
          .col-md-3
        </div>
        <div class="col-md-6">
          .col-md-6
        </div>
        <div class="col-md-3">
          
        </div>
      </div>
     
    </div>   
  );
}

export default InicioWeb;
